from typing import List
from collections import defaultdict

class Solution:
    def minimumCost(self, source: str, target: str, original: List[str], changed: List[str], cost: List[int]) -> int:
        n = len(source)
        dp = [float('inf')] * (n + 1)
        dp[0] = 0
        conversion_dict = defaultdict(list)

        for i in range(len(original)):
            conversion_dict[(original[i], changed[i])].append(cost[i])

        for i in range(1, n + 1):
            dp[i] = dp[i - 1]  # In case no conversion is possible, assume no cost added.

            for j in range(i):
                src_substr = source[j:i]
                tgt_substr = target[j:i]
                if (src_substr, tgt_substr) in conversion_dict:
                    min_cost = min(conversion_dict[(src_substr, tgt_substr)])
                    dp[i] = min(dp[i], dp[j] + min_cost)

                for k in range(len(src_substr)):
                    for l in range(k + 1, len(src_substr) + 1):
                        src_sub_substr = src_substr[k:l]
                        tgt_sub_substr = tgt_substr[k:l]
                        if (src_sub_substr, tgt_sub_substr) in conversion_dict:
                            min_cost = min(conversion_dict[(src_sub_substr, tgt_sub_substr)])
                            if j + k == 0 or dp[j + k] != float('inf'):
                                dp[i] = min(dp[i], dp[j + k] + min_cost)

        return dp[n] if dp[n] != float('inf') else -1
